import React from 'react';
import MenuItem from '../menu-items/menu-items.componenta';
import './directory.style.css';



class Directory extends React.Component{
    constructor () {
  super();
 
  this.state = {
      sections :[
          {title: 'HATS',
          imageSrc : <img src='../images/hats/3.jpg' alt='HATS'/>,
          id:1,
          linkUrl: 'hats'
        },
      
          {title: 'JACKETS',
          imageSrc : <img src='../images/jackets/3.jpg'/>,
          id:2,
          linkUrl: 'jackets'

        },

         {title: ' SNEAKERS',
         imageSrc : <img src='../images/shoes/2.jpg'/>,
         id:3,
         linkUrl: 'SNEAKERS'
        },
         
         {title: 'MENs',
          imageSrc : <img src='../images/models/1' alt='MENS'/>,
          size:'large',
          id:4,
         linkUrl: 'MENs'

          },
         
         {title: 'WOMENs',
         imageSrc : '../images/models/4',
         size:'large',
         id:5,
         linkUrl: 'SNEAKERS'
        }
        ] 
       }

 }
 render(){
     return(
        <div className ='directory-menu'>
            {
                this.state.sections.map(({title,imageSrc,id,size}) => (
                <MenuItem key={id} title={title} imageSrc={imageSrc} size ={size} history={this.props.history}/>
            
            ))}
        </div>
     )
 }

}
export default Directory;
